import React from 'react';

function App() {
  var counter = 0;
  function incrementCounter(){
    counter++;
  }
  return (
    <>
      <h1>Contador: 0</h1>
      <button onClick={incrementCounter}>Incrementar</button>
    </>
  );
}

export default App;
